{"title":"grid-image-cm0wy910903ztlf04jo9ccszi","url":"images/165e36ae9f644b5a9bc83b56e2c45370.jpeg","description":"Fluttering Fantasies\rSimple dali-rockwell-picasso-munch where&#39;s-wally style humorous depiction of low-gravity airborn buildings, vehicles, and people being blown about by the wind, including scenes of property damage, people tying themselves to poles, livestock tethered and drifting, floating crops, sleepless residents strapped into beds, children flying kites lifting themselves, and chaos with debris flying everywhere. \r\rBuildings drift, collide midair like bumper cars; property damage rampant. Inspectors endlessly anchor floating homes, adjusting ever-shifting land. People tie themselves to poles, waiting for drifting buses, swept away without heavy boots. Vehicles crash midair, stuck in trees. Livestock tethered, drifting sheep blown into neighboring towns. Cows, horses chew air, blown from feed. Floating crops, uprooted by wind, hover above fields. Farmers chase vegetables, groceries disappear into sky. Sleepless residents strap into beds, tethered like astronauts, afraid to float away overnight. Anchored houses shift with the wind; streets rearrange. Children fly kites, lift themselves accidentally; floating toys, benches, cows spiral. Ball games‚Äîplayers, balls float away, impossible sports. Shops hover, merchandise lost. Postal workers chase airborne packages, delivery trucks drift away. Conversations interrupted mid-sentence as people, clothes blown apart. A casual handshake rips people skyward. Chaos reigns; debris flies everywhere. No safe boundaries‚Äîeverything, everyone lost to the wind. Balloon-like collisions of livestock, buildings, vehicles. A floating town, helpless, at wind‚Äôs mercy: the impossible made real.\r\r(Full description bonus -- AK)\r"},

R, Fujifilm quality with dappled lighting enhancing every detail.\r"},

{"title":"grid-image-cm0wz7ck604f12amox7c7alv5","url":"images/a81b7e6f10cd420eb655b740ba9cbec4.jpeg","description":"Fluttering Fantasies,\rSimple Handford-Rockwell-Klimt-Beeple-Newland-Dali-Hattori-Munch-Rutkowski style humorous depiction of ((low-gravity airborn buildings, vehicles, and people)) being blown about by the wind, including property damage, people tying themselves to poles, livestock tethered and drifting, floating crops, sleepless residents strapped into beds, children flying kites lifting themselves, and chaos with debris flying everywhere. \r\rBuildings drift, collide midair like bumper cars; property damage rampant. Inspectors endlessly anchor floating homes, adjusting ever-shifting land. People tie themselves to poles, waiting for drifting buses, swept away without heavy boots. Vehicles crash midair, stuck in trees. Livestock tethered, drifting sheep blown into neighboring towns. Cows, horses chew air, blown from feed. Floating crops, uprooted by wind, hover above fields. Farmers chase vegetables, groceries disappear into sky. Sleepless residents strap into beds, tethered like astronauts, afraid to float away overnight. Anchored houses shift with the wind; streets rearrange. Children fly kites, lift themselves accidentally; floating toys, benches, cows spiral. Ball games‚Äîplayers, balls float away, impossible sports. Shops hover, merchandise lost. Postal workers chase airborne packages, delivery trucks drift away. Conversations interrupted mid-sentence as people, clothes blown apart. A casual handshake rips people skyward. Chaos reigns; debris flies everywhere. No safe boundaries‚Äîeverything, everyone lost to the wind. Balloon-like collisions of livestock, buildings, vehicles. A floating town, helpless, at wind‚Äôs mercy: the impossible made real.\r\r(Full description bonus -- AK)\r"},

// ------------------------------------
function buildYArray(initialImages) {
  // Check if initialImages is an array
  if (!Array.isArray(initialImages)) {
    throw new TypeError('initialImages must be an array');
  }

  // Create an empty array to store the results
  const yArray = [];

  // Loop through each element in initialImages
  for (const x of initialImages) {
    // Create a new y object for each x
    const y = {
      path: x.url.replace('https://images.playground.com/', 'images/'),
      title: x.title,
      description: x.prompt,
      modified: x.createdAt,
    };

    // Push the y object to the yArray
    yArray.push(y);
  }

  return yArray;
}


// ------------------------------------
function populateDiv(divElement, yArray) {
  divElement.innerHTML = ''; // Clear existing content

  for (const y of yArray) {
    const div = document.createElement('div');
    div.classList.add('image-container'); // Add a class for styling

    const img = document.createElement('img');
    img.src = y.path;
    div.appendChild(img);

    const title = document.createElement('p');
    title.textContent = y.title;
    div.appendChild(title);

    const description = document.createElement('p');
    description.textContent = y.description;
    div.appendChild(description);

    const modified = document.createElement('p');
    modified.textContent = y.modified;
    div.appendChild(modified);

    divElement.appendChild(div);
  }
}

// ------------------------------------
try {
  const yArray = buildYArray(udata.initialImages);
//  console.log(yArray); // Output the resulting array of y objects
  const divElement = document.getElementById('output');
  populateDiv(divElement, yArray);
} catch (error) {
  console.error('Error:', error.message); // Handle potential errors
}
